import React from 'react'
import Form from 'react-bootstrap/Form'

class GlobalNav extends React.Component {
    constructor(props) {
        super(props);

        this.links = [
            'HelloWorld',
            'CustomComponentBuilder'
        ];

        this.search = '';
    }

    render() {
        return (
            <nav id="global-nav">
                <Form>
                    <Form.Group>
                        <Form.Control type={'text'} placeholder={'Search'} value={this.search}/>
                    </Form.Group>
                </Form>
                {this.links.filter(this.filterLink).map((row, i) =>
                    <a href={row} key={i}>{row}</a>
                )}
            </nav>
        )
    }
}

export default GlobalNav
